multilist.ondoubleclick:
var /*Table*/table = meibo.getField("EVENTS_TABLE");
var /*int*/ selectedRowIndex = table.getSelectedRow();
var /*String*/ selectedEventDn = table.getRowObject(selectedRowIndex);
//meibo.switchToDisplayView("Event", selectedEventDn,0);
showEventDetails();

///$debug
var /*Table*/table = meibo.getField("MISSION_TABLE");
var /*int*/ selectedRowIndex = table.getSelectedRow();
var /*String*/ selectedMissionDn = table.getRowObject(selectedRowIndex);
meibo.switchToDisplayView("Mission", selectedMissionDn,0);

button.onclick:
///$debug
meibo.showField("error", false);
var missionId = meibo.getFieldValue("TMN_ID");
var comment = meibo.getFieldValue("COMMENT");
var /*String*/ userId = meibo.getGlobalVar(GLOBALVAR_CURRENT_USER_ID);

meibo.logInfo("Annulation de la mission " + missionId + " par " + meibo.getUserDn());
updateMissionStatus(missionId, userId, "CAN", comment);
meibo.setWorkflowVariable("comment", comment);
meibo.setWorkflowVariable("finalConfirmation", "false");
meibo.completeCurrentWorkflowTask();
meibo.setActiveTab(3);

meibo.showField("error", false);
var missionId = meibo.getFieldValue("TMN_ID");
var comment = meibo.getFieldValue("COMMENT");
var /*String*/ userId = meibo.getGlobalVar(GLOBALVAR_CURRENT_USER_ID);

meibo.logInfo("Mission " + missionId + " organisée par " + meibo.getUserDn());
updateMissionStatus(missionId, userId, "ORG", comment);
meibo.setWorkflowVariable("organisationComment", comment);
meibo.setWorkflowVariable("organised", "true");
meibo.completeCurrentWorkflowTask();
meibo.setActiveTab(2);
